query:
query events ( $accountID:ID! $timeFrame:TimeFrame! $eventsMeasure:[EventsMeasure] $eventsDimension:[EventsDimension] $eventsFilter:[EventsFilter!] $eventsPostAggFilter:[EventsPostAggFilter!] $eventsSort:[EventsSort!] $limit:Int $from:Int) {
	events ( accountID:$accountID timeFrame:$timeFrame measures:$eventsMeasure dimensions:$eventsDimension filters:$eventsFilter postAggFilters:$eventsPostAggFilter sort:$eventsSort ) {
		id
		from
		to
		total
		totals
		records ( limit:$limit  from:$from  )  {
			fieldsUnitTypes
			fieldsMap
			trends
			prevTimeFrame
			flatFields
		}
	}	
}
